import React from 'react';
import './Signup.css';
import ReactDOM from 'react-dom';

const SignIn=()=>{
let inputsigninemail=null;
let inputsigninpassword=null;

const Inputsigninemail = (e) =>{
    inputsigninemail=e.target.value;
  }
  const Inputsigninpassword = (e) =>{
    inputsigninpassword=e.target.value;
  }
const verificationSignIn = () =>{
    if((inputsigninemail===null)||(inputsigninpassword===null)){
      alert("Could not Sign-In");
    }
    else{
       alert("signed In successfully");
    }
   
  }
const Signin = (props) => {
    return (
            <div> 
               <div className="signup">
                   <p className="text">Enter Email Add. :</p>
                   <input className="inputbox" type="email" onChange={props.email} />
               </div>
               <div className="signup">
                   <p className="text">Enter Password :</p>
                   <input className="inputbox" type="password"onChange={props.password} />
               </div><br/>
            <button type="submit" onClick={props.verify}>Submit</button>
           </div>
    );
}

return(ReactDOM.render( <React.StrictMode><Signin verify={verificationSignIn} email={Inputsigninemail}  password={Inputsigninpassword} /></React.StrictMode>,document.getElementById('root')));}
export default SignIn;
